// Import Styled
import styled from 'styled-components';

export const Logo = styled.text`
	h1{
		color: #FFFFFF80;
		font-family: "Rubik";
		font-size: 20px;
		line-height: 24px;    
		display: inline-block;
		font-weight: normal;
		letter-spacing: 0.75px;
		strong{
			font-family: "Roboto";
			color: #FFFFFF;
		}
	}
`;
